import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { ProfileProvider } from "./ProfileProvider"; // Import the ProfileProvider component
import Home from "../src/components/Home";
import Login from "../src/components/Login";
import Register from "../src/components/Register";
import Favorite from "../src/components/Favorite";
import AddTab from "../src/components/AddTab";
import Archive from "../src/components/ArchiveSong";
import Profile from "../src/components/Profile";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <ProfileProvider>
            {" "}
            {/* Wrap the routes that require profile data with ProfileProvider */}
            <Route path="/home" element={<Home />} />
            <Route path="/favorite" element={<Favorite />} />
            <Route path="/addtab" element={<AddTab />} />
            <Route path="/archive" element={<Archive />} />
            <Route path="/profile" element={<Profile />} />
          </ProfileProvider>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
